import React, { Component } from 'react';
import FiberManualRecordOutlined from '@material-ui/icons/FiberManualRecordOutlined';

class SvgMaterialIcons extends Component {
  render(){
    return(
        <FiberManualRecordOutlined fontSize='small'/>      
    );
  }
}

export default SvgMaterialIcons
